import React, { useState } from 'react';
import './App.css';

function Home() {
  const [showBackground, setShowBackground] = useState(false);

  const toggleBackground = () => {
    setShowBackground(current => !current);  // Toggle the current state
  };

  return (
    <div className="App">
      <header className="App-header">
        <img
          src={`${process.env.PUBLIC_URL}/logo.png`}
          className="App-logo"
          alt="logo"
          onClick={toggleBackground}  // Toggle background on logo click as well
        />
        <div className="contact-container">
          <span className="App-contact-text">CONTACT</span>
        </div>
      </header>

      <div className={`App-background ${showBackground ? 'show' : ''}`}></div>

      <img
        src={`${process.env.PUBLIC_URL}/tree.png`}
        className="Tree-image"
        alt="Tree"
        onClick={toggleBackground} // Toggle background on tree image click
      />

      <footer className="App-footer">
        <p>&copy; 2024 WILLO - All Rights Reserved.</p>
      </footer>
    </div>
  );
}

export default Home;
